import React, { useState, useEffect, useRef } from 'react';
import { View, Text, TouchableOpacity, Image, StyleSheet } from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import NavBar from '../components/NavBar';
import { SvgXml } from 'react-native-svg';
import MapView, { Marker } from 'react-native-maps';
import { getUserData } from '../server/server';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { decode } from 'base-64';
import { useProfile } from '../components/ProfileContext';
import * as Location from 'expo-location';

const HomeScreen = ({ route, navigation }) => {
  const mapRef = useRef(null);
  const { eventsData } = route.params || { eventsData: [] };
  const { profData, setProfData } = useProfile();
  const [username, setUsername] = useState(profData.username || '');
  const [userLocation, setUserLocation] = useState({ latitude: 0, longitude: 0 });
  const [userData, setUserData] = useState([]);
  const events = eventsData;
  const [latitudes, setLatitudes] = useState(profData.location?.coordinates[0] || 0);
  const [longitudes, setLongitudes] = useState(profData.location?.coordinates[1] || 0);

  const handleShowLocation = () => {
    console.log(userLocation);
    if (mapRef.current) {
      mapRef.current.animateToRegion({
        latitude: userLocation.latitude,
        longitude: userLocation.longitude,
        latitudeDelta: 0.05,
        longitudeDelta: 0.05,
      });
    }
  };

  useEffect(() => {
    const getProfileData = async () => {
      try {
        const token = await AsyncStorage.getItem('token');
        if (token) {
          const tokenPayload = JSON.parse(decode(token.split('.')[1]));
          const userId = tokenPayload.id;
          const response = await getUserData(userId);
          if (response.user) {
            setUserData(response.user);
            if (!profData) {
              setProfData(response.user);
            }
          } else {
            console.log('Failed to get user profile data.');
          }
        }
      } catch (error) {
        console.error('Error fetching profile data:', error);
      }
    };

    if (!profData) {
      getProfileData();
    }
  }, [profData]);

  useEffect(() => {
    const getUserLocation = async () => {
      try {
        let { status } = await Location.requestForegroundPermissionsAsync();
        if (status !== 'granted') {
          console.log('Permission to access location was denied');
          return;
        }

        let location = await Location.getCurrentPositionAsync({});
        setUserLocation({
          latitude: location.coords.latitude,
          longitude: location.coords.longitude,
        });
        setLatitudes(location.coords.latitude);
        setLongitudes(location.coords.longitude);
      } catch (error) {
        console.error('Error fetching user location:', error);
      }
    };

    getUserLocation();
  }, []);

  const handleNotifications = () => {
    navigation.navigate('NotificationScreen');
  };
  const notificationIcon = `
    <svg width="24" height="24" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
    <path fill-rule="evenodd" clip-rule="evenodd" d="M12 17.8476C17.6392 17.8476 20.2481 17.1242 20.5 14.2205C20.5 11.3188 18.6812 11.5054 18.6812 7.94511C18.6812 5.16414 16.0452 2 12 2C7.95477 2 5.31885 5.16414 5.31885 7.94511C5.31885 11.5054 3.5 11.3188 3.5 14.2205C3.75295 17.1352 6.36177 17.8476 12 17.8476Z" stroke="#666666" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round"/>
    <path d="M14.3888 20.8572C13.0247 22.3719 10.8966 22.3899 9.51945 20.8572" stroke="#666666" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round"/>
    </svg>
  `;

  const handWave = `
  <svg width="16" height="16" viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
  <rect width="16" height="16" fill="url(#pattern0)"/>
  <mask id="mask0_298_3346" style="mask-type:alpha" maskUnits="userSpaceOnUse" x="0" y="0" width="16" height="16">
  <rect width="16" height="16" fill="url(#pattern1)"/>
  </mask>
  <g mask="url(#mask0_298_3346)">
  <path d="M0 14.3162V9.68457H1.89474L6.31579 14.3162H0Z" fill="#5271FF"/>
  <path d="M12.2105 4.63158V0H8.00001L7.36843 1.05263L10.1053 4.63158H12.2105Z" fill="#5271FF"/>
  </g>
  <defs>
  <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
  <use xlink:href="#image0_298_3346" transform="scale(0.00390625)"/>
  </pattern>
  <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
  <use xlink:href="#image0_298_3346" transform="scale(0.00390625)"/>
  </pattern>
  <image id="image0_298_3346" width="256" height="256" xlink:href="data:image/png;base64,"/>
  </defs>
  </svg>
  
  `;
  return (
    <View style={{ flex: 1 ,  backgroundColor: 'white'}}>
      <View style={{display:'flex', flexDirection:'row', justifyContent:'space-between', alignItems:'center', marginTop:50, paddingHorizontal:20}}>
        <Text style={{fontFamily:'Poppins-Medium', fontSize:18}}>HOME</Text>
        <SvgXml xml={notificationIcon} width={25} height={25} onPress={handleNotifications}/>
      </View>
      <View style={{display:'flex', flexDirection:'row', alignItems:'center', marginTop:20, paddingHorizontal:20}}>
        <Image source={require('../assets/images/logo-rounded.png')} style={styles.logo} />
        <View style={{display:'flex', flexDirection:'column', alignItems:'start'}}>
          <View style={{display:'flex', flexDirection:'row', alignItems:'center'}}>
            <Text style={{fontFamily:'Poppins', color:'gray', marginRight:4}}>Welcome Back</Text>
            <SvgXml xml={handWave} width={18} height={18} />
          </View>
          <Text style={{fontFamily:'Poppins'}}>{username}</Text>
        </View>
      </View>
      <MapView
        style={styles.map}
        initialRegion={{
          latitude: latitudes,
          longitude: longitudes,
          latitudeDelta: 0.0922,
          longitudeDelta: 0.0421,
        }}
        ref={mapRef}
      >
        {/* Marker for user's location */}
        <Marker
          coordinate={{ latitude: latitudes, longitude: longitudes }}
          title="Your Location"
          description="This is your location"
        />
        {/* Markers for all events */}
        {events.map((event) => (
          <Marker
            key={event._id}
            coordinate={{
              latitude: event.location.coordinates[1],
              longitude: event.location.coordinates[0],
            }}
            title={event.title}
            description={event.description}
          />
        ))}
      </MapView>
      <TouchableOpacity style={styles.locationButton} onPress={handleShowLocation}>
        <Ionicons name="locate-outline" size={24} color="black" />
      </TouchableOpacity>
      <NavBar />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  logo: {
    width: 45,
    height: 45,
    borderRadius:45/2,
    padding:1,
    borderWidth:1,
    borderColor:'red',
    marginRight:10
},
map: {
  flex: 1,
  marginTop:10
},
locationButton: {
  position: 'absolute',
  bottom: 115,
  right: 20,
  backgroundColor: 'white',
  borderRadius: 50,
  padding: 10,
  elevation: 5,
},
});


export default HomeScreen;